    set @rs = (select sum(case when MH.`type` = 1 then ifnull(MH.money_bonus,0) else (0-ifnull(MH.money_bonus,0)) end) - sum(case when MH.`type` = 1 then ifnull(MH.withdraw,0) else (0-ifnull(MH.withdraw,0)) end) from money_history as MH left join `user` AS U on U.id = MH.user_id where MH.user_id = user_id and MH.`active` = 1 and U.is_agency = 1 and U.active = 1 );
RETURN ifnull(@rs,0);   
END ;;
