CREATE DEFINER=`root`@`localhost` PROCEDURE `get_all_menu_by_user`(user_id int)
BEGIN
	
set @is_admin = (select is_admin from `user` where `user`.id = user_id limit 1);
    set @is_admin_by_agency = (select is_admin from `user` where `user`.id = user_id and user.is_agency = 1 limit 1);
    
    if(@is_admin_by_agency != 1) then
        select *,id as menu_id,1 as stt from menu where is_admin != 1 order by `order`;
        else 
        BEGIN
    if(@is_admin != 1) then
        /*select UM.*,M.action,U.`username`,M.name from user_menu as UM 
		left join menu AS M on UM.menu_id = M.id 
		left join `user` as U on UM.user_id = U.id
		where UM.user_id = user_id and UM.stt = 1 and M.is_admin = 0
		order by M.`order`;*/
        select *,id as menu_id,1 as stt from menu where is_admin = 0 order by `order`;
    else
		select *,id as menu_id,1 as stt from menu where is_admin = 1 order by `order`;
        end if;
    end ;
    end if;
	
END ;;
