CREATE DEFINER=`root`@`localhost` PROCEDURE `user_getall`(IN `pic` INT)
BEGIN
	select `user`.`id`,
    `user`.`username`,
    TBT1.money,
    TBT1.bonus,
     TBT1.money_month,
    `user`.`is_admin`,
    `user`.`active`,
    `user`.`real_name`,
    `user`.`phone`,
    `user`.`add`,
    `user`.`created_at`,
    `user`.`is_agency`, 
    `user`.`agency_time`,
    (select Date_add(PH.time,interval sum(P.limit_day) day) as limit_time from pricing_history AS PH left join pricing AS P on P.id = PH.pricing_id
	where PH.user_id = `user`.`id` AND PH.pricing_active = 1 and PH.limit_day = 0 limit 1) as limit_time, 
    (select sum(pricing_history.limit_day) as limit_day from pricing_history where pricing_history.user_id = user.id and pricing_history.pricing_active = 1 LIMIT 1) as total_day,
    (select Date_add(pricing_history.time,interval sum(pricing_history.limit_day) day) as limit_time_ from pricing_history where pricing_history.user_id = user.id and pricing_history.pricing_active = 1 and pricing_history.limit_day != 0 limit 1) as limit_time_,
    `user`.`created_by` from `user` 
    left join (select MH.user_id,
sum(case when MH.`type` = 1 then ifnull(MH.money,0) else (0-ifnull(MH.money,0)) end) as money,
if(U.is_agency = 1 and U.active = 1,sum(case when MH.`type` = 1 then ifnull(MH.money_bonus,0) else (0-ifnull(MH.money_bonus,0)) end) - sum(case when MH.`type` = 1 then ifnull(MH.withdraw,0) else (0-ifnull(MH.withdraw,0)) end),0) as bonus,
if(MONTH(DATE_FORMAT(FROM_UNIXTIME(MH.time),'%Y-%m-%d %H:%i:%s')) = MONTH(CURRENT_DATE()),sum(case when MH.`type` = 1 then ifnull(MH.money,0) end),0) as money_month
from money_history as MH 
left join `user` as U on MH.user_id = U.id
where MH.`active` = 1 group by MH.user_id order by MH.user_id) as TBT1 on TBT1.user_id = `user`.id
    where `user`.`active` = 1 ORDER by `user`.`is_admin` DESC,`user`.`is_agency` DESC,money_month DESC,`user`.`username` ASC;
END ;;
