CREATE DEFINER=`root`@`localhost` PROCEDURE `user_getbyagency`(IN `pic` INT)
BEGIN
	SELECT
    `user`.`id`,
	(SELECT SUM(get_current_money(PH.id)) AS total_money FROM user AS PH WHERE PH.par_id = `user`.`id` AND PH.active = 1) AS total_money,
    (SELECT SUM(get_current_bonus(PH.id)) AS total_bonus FROM user AS PH WHERE PH.par_id = `user`.`id` AND PH.active = 1) AS total_bonus,
    (SELECT SUM(get_moth_money(PH.id)) AS total_month FROM user AS PH WHERE PH.par_id = `user`.`id` AND PH.active = 1) AS total_month,
    (SELECT COUNT(PH.par_id) AS total_user FROM user AS PH WHERE PH.par_id = `user`.`id` AND PH.active = 1) AS total_user,
