    `user`.`phone`,
    `user`.`add`,
    `user`.`created_at`,
    `user`.`created_by`,
    `user`.`is_public`,
    `user`.`par_id`,
    `user`.`ref`,
    `user`.`is_agency`,
    `user`.`agency_time` FROM `user` where is_agency = 1 and active = 1;
